  function 导出数组(模式,数组,路径) --模式1=普通数组 模式2=含有子数组
    dc={""}
    zsz={""}
    if(模式==1)then
        if(#数组==1)then
          dc[1]="{"..tostring(数组[1].."}")
         else
            for i=1, #(数组) do
              if(i==1)then
                dc[1]="{"..tostring(数组[1]..",")
                else
                  if(i==#(数组))then
                  dc[1]=dc[1]..tostring(数组[i].."}")
                  else
                  dc[1]=dc[1]..tostring(数组[i]..",")
                  end
              end
            end
        end
    end

    if(模式==2)then
        if(#数组==1)then
            if(#数组[1]==1)then
              zsz[1]="{"..tostring(数组[1][1].."}")
             else
              for i=1, #数组[1] do
                  if(i==1)then
                    zsz[1]="{"..tostring(数组[1][1]..",")
                    else
                      if(i==#(数组)[1])then
                      zsz[1]=zsz[1]..tostring(数组[1][i].."}")
                      else
                      zsz[1]=zsz[1]..tostring(数组[1][i]..",")
                      end
                  end
              end
            end
         else
            for i=1,#(数组) do--3组
              for v=1,#(数组)[i] do--遍历数组
                 if(v==1)then
                    if(i==1)then
                      zsz[1]="{"..tostring(数组[1][1]..",")
                    else
                       if(v==#(数组)[i])then
                          zsz[1]=zsz[1]..",{"..tostring(数组[i][1].."}")
                         else
                          zsz[1]=zsz[1]..",{"..tostring(数组[i][1]..",")  
                       end
                    end
                 else
                     if(v==#(数组)[i])then
                        zsz[1]=zsz[1]..tostring(数组[i][v].."}")
                        else
                        zsz[1]=zsz[1]..tostring(数组[i][v]..",")
                      end
                 end
              end
            end
        end
      dc[1]="{"..zsz[1].."}" 
    end
    
   io.open(路径,"w"):write(dc[1]):close()
  end--使用方法 导出数组(a) 导出数组(数组,路径)  a为数组

