  function 数组去重(数组)
      local b = {}
      for k,v in ipairs(数组) do
          if(#b == 0) then
              b[1]=v;
          else
              local index = 0
              for i=1,#b do
                  if(v == b[i]) then
                      break

                  end
                  index = index + 1
              end
              if(index == #b) then
                  b[#b + 1] = v;
              end
          end
      end
      return b
  end--用法narr=数组去重(数组)  ---narr是更新后的数组

